import { AntDesign } from '@expo/vector-icons';
import React from 'react';
import {Text, ScrollView,Image,Button,TouchableOpacity,img} from 'react-native';
import { TextInput } from 'react-native-paper';
import logo from './assets/logo_canteen.png';
const YourApp = () => {
  return (
    <ScrollView >

        <img src={logo} style={{width: 110,height:110}}></img>
        <TextInput right={<TextInput.Icon icon="magnify"/>}></TextInput>

    </ScrollView>
  );
};

export default YourApp;
